function ButtonLogin(props) {
const [fullName, setFullName] = useState();
    const onSubmits = () => {
        setFullName();
    }
    return (
        <>
            <button type="submit" onClick={onSubmits}>Login</button>
        </>
    )
}

export default ButtonLogin
